import { sql_query } from '../db'

const handlerSaoPaulo = async (_, res) => {
  try{
    const results = await sql_query(`SELECT * FROM tab_menu WHERE mn_oculto=0 AND mn_destaque=1 AND (mn_esubpasta=152 or mn_esubpasta=168) ORDER BY mn_peso DESC, mn_titulo DESC LIMIT 4`)
    // 168, 5443, 169, 155, 158, 153, 154, 152
    return res.json(results)
  } catch (e) {
    
    res.status(500).json({ message: e.message })
    
  }
}

export default handlerSaoPaulo
